import React from "react";
import "./App.css";
import { UserList } from "./UserList";
import { UserContextProvider } from "./Contexts/userContext";

function App() {
	return (
		<UserContextProvider value={handleQueryChange}>
			<div className="center">
				<h1>Github user searcher</h1>
				<input placeholder="Search for user" onChange={handleQueryChange} />
				<UserList />
			</div>
		</UserContextProvider>
	);
}

export default App;
